import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";
import "./ClubDetails.css";

const ClubDetails = () => {
  const { clubId } = useParams();
  const [club, setClub] = useState(null);
  const [players, setPlayers] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchClubData = async () => {
      try {
        const clubResponse =await axios.get("http://localhost:8080/api/v1/clubs/1");
        const transformedData = clubResponse.data.map((club) => ({
          name: club.clubName,
          league: club.leagueName,
          reputation: club.reputation,
          manager: club.managerName,
          foundationDate:club.foundationDate
        }));
       /* const playersResponse = await axios.get(
          `http://localhost:8080/api/v1/clubs/${clubId}/players`
        );*/
        setClub(transformedData);
        //setPlayers(playersResponse.data);
      } catch (err) {
        console.error("Error fetching data:", err);
        setError("Failed to load club details. Please try again later.");
      }
    };

    fetchClubData();
  }, [clubId]);

  const getReputationColor = (reputation) => {
    if (reputation >= 85) return "purple";
    if (reputation >= 70) return "blue";
    if (reputation >= 50) return "green";
    return "red";
  };

  if (error) {
    return <div>{error}</div>;
  }

  if (!club) {
    return <div>Loading club details...</div>;
  }

  return (
    <div className="club-details">
      <div className="club-info">
        <p><h2>{club.name}</h2></p>
        <p><strong>Foundation Date:</strong> {club.foundationDate}</p>
        <p><strong>League:</strong> {club.league}</p>
        <p>
          <strong>Reputation:</strong>{" "}
          <span style={{ color: getReputationColor(club.reputation) }}>
            {club.reputation}
          </span>
        </p>
        <p><strong>Manager:</strong> {club.manager}</p>
      </div>

      <div className="club-players">
        <h3>Players</h3>
        <table className="players-table">
          <thead>
            <tr>
              <th>Name</th>
              <th>Position</th>
              <th>Age</th>
              <th>Rating</th>
            </tr>
          </thead>
          <tbody>
            {players.map((player) => (
              <tr key={player.id}>
                <td>{player.name}</td>
                <td>{player.position}</td>
                <td>{player.age}</td>
                <td>{player.rating}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default ClubDetails;
